INSERT INTO `feedback` VALUES ('01fe5229-58ef-486e-8241-39fd3f37e0b1','[{\"second\":1,\"expression\":\"sad\",\"score\":96.6517333984375},{\"second\":2,\"expression\":\"sad\",\"score\":89.52261352539062},{\"second\":3,\"expression\":\"angry\",\"score\":37.664310455322266},{\"second\":4,\"expression\":\"sad\",\"score\":97.9871597290039}]','제가 경험했던 어려운 상황 중 하나는 면접 준비 과정에서의 불안감이었습니다. 상황은 대기업 면접을 앞두고 가질 수 있는 긴장 상태로, 이는 제 실력을 제대로 발휘하지 못하게 할 것 같아 걱정이 컸습니다. 이를 극복하기 위해, 저는 우선 면접 질문과 준비 과정을 체계적으로 정리했습니다. 그 후 여러 번의 모의 면접을 통해 실전 경험을 쌓았고, 피드백을 통해 취약점을 보완했습니다. 이러한 방법 덕분에 실제 면접 때는 자신감 있게 저의 역량을 발휘할 수 있었고, 결과적으로 긍정적인 피드백을 받을 수 있었습니다.','[{\"start\":0.0,\"end\":2.12,\"text\":\" 테스트 중입니다.\",\"intent\":\"태도(H/W, S/W 역량)\"}]','테스트 중입니다.','863a8a45-ddab-45fc-858d-002773993093',1,NULL,NULL),('88694d85-8206-4c5d-8da0-830a2ab41725','[{\"second\":1,\"expression\":\"fear\",\"score\":67.96070098876953},{\"second\":2,\"expression\":\"sad\",\"score\":98.9865493774414},{\"second\":3,\"expression\":\"sad\",\"score\":94.10857391357422},{\"second\":4,\"expression\":\"sad\",\"score\":86.6016616821289}]','저는 팀원들과의 원활한 소통을 통해 프로젝트를 성공적으로 이끌어낸 경험이 있습니다. 한 번은 기계 가공 프로젝트를 진행할 때, 팀원들과의 협업이 특히 중요했습니다. 이 과정에서 저는 팀원들의 의견을 경청하고, 주기적인 미팅을 통해 진행 상황을 공유했습니다. 또한, 어려운 부분에 대해 문제를 해결하기 위한 브레인스토밍 세션을 주최하여 다양한 아이디어를 모았습니다. 이러한 과정을 통해 팀원들은 서로의 강점을 이해하고, 그 결과 프로젝트는 정해진 기한 안에 성공적으로 마무리되었습니다. 커뮤니케이션의 원활함 덕에 프로젝트 목표를 조기에 달성할 수 있었고, 팀 전체의 사기도 높아졌습니다.','[{\"start\":0.0,\"end\":1.7,\"text\":\" 다음 영상도 웃저주세요\",\"intent\":\"인성(갈등 관리)\"}]','다음 영상도 웃저주세요','d5186166-0892-4dbf-8112-eac01cf10f91',1,NULL,NULL),('960d4dfe-5dd9-4e12-ad3d-f6c72fc5a815','[{\"second\":1,\"expression\":\"angry\",\"score\":94.90982055664062},{\"second\":2,\"expression\":\"sad\",\"score\":92.30171203613281},{\"second\":3,\"expression\":\"sad\",\"score\":97.63972473144531}]','제가 이전에 진행한 프로젝트에서, 새로운 기계 가공 프로세스를 도입할 때 매우 중요한 교훈을 배웠습니다. 이 프로젝트의 상황(Situation)은 기존 생산 방식에서 품질 문제가 발생하였고, 이는 고객의 신뢰도에 영향을 미쳤습니다. 그러한 Task로서, 저는 이 문제를 해결하기 위해 새로운 기계 가공 기술을 연구하고 도입할 필요성을 느꼈습니다. Action 단계에서, 다양한 자료를 분석하여 최적의 기술을 선정하였고, 이를 통해 팀원들과 협력하여 새로운 공정을 실험하고, 개선 사항을 지속적으로 반영하며 실행했습니다. Result적으로는 품질이 30% 향상되었고 고객의 피드백에 따라 시장에서의 경쟁력이 강화되었습니다. 이 경험을 통해 저는 기술적 분석과 팀워크의 중요성을 깨닫게 되었고, 새로운 도전에 대한 자신감을 얻었습니다.','[{\"start\":0.0,\"end\":0.9400000000000001,\"text\":\" 예..\",\"intent\":\"배경(사적인 경험)\"}]','예..','2308898b-1e00-41b2-9ea4-96d08926ef98',1,NULL,NULL),('ab78da4d-0034-4f2d-b8c9-35f2e2f73141','[{\"second\":1,\"expression\":\"sad\",\"score\":78.494873046875},{\"second\":2,\"expression\":\"sad\",\"score\":99.52196502685547},{\"second\":3,\"expression\":\"sad\",\"score\":88.32142639160156},{\"second\":4,\"expression\":\"neutral\",\"score\":97.4332046508789}]','제가 맡았던 기계공작 프로젝트는 예상보다 복잡한 요구사항이 있었습니다. 초기 단계에서 고객의 니즈를 충분히 이해하지 못해, 프로젝트 진행 중 여러 차례의 수정 요청이 들어왔습니다. 이러한 상황에서 저는 고객과의 지속적인 소통을 강화하기로 결정했습니다. 주기적으로 미팅을 열어 진행 상황을 공유하고, 고객의 피드백을 반영하여 설계안을 수정했습니다. 또한, 팀원들과의 협업을 통해 문제를 조기에 발견하고 빠르게 해결할 수 있도록 했습니다. 이러한 노력 덕분에 최종 결과물은 고객의 기대를 초과 달성하였으며, 프로젝트는 정시에 종료되었습니다. 이 경험을 통해 고객의 요구를 명확히 파악하고, 유연하게 대응하는 법을 배웠습니다.','[{\"start\":0.0,\"end\":0.92,\"text\":\" 해�许�가\",\"intent\":\"배경(사적인 경험)\"}]','해�许�가','bdd79eaf-2f6e-42d8-86a4-eabadf96fce2',1,NULL,NULL),('ac2f9718-9205-4036-a657-23ace5641205','[{\"second\":1,\"expression\":\"neutral\",\"score\":99.98966979980469},{\"second\":2,\"expression\":\"sad\",\"score\":90.37740325927734},{\"second\":3,\"expression\":\"happy\",\"score\":96.41927337646484},{\"second\":4,\"expression\":\"sad\",\"score\":98.56767272949219}]','과거 영업팀의 일원으로서 둘 사이에 신뢰를 쌓기 위한 과정이 있었습니다. 한 고객이 특정 제품에 대해 부정적인 인식을 가지고 있었는데, 이를 극복하기 위해 상황에 맞는 솔루션을 제공하여 애프터 서비스 문제를 해결했습니다. 고객의 입장에서 생각하며 문제를 상세히 분석하고, 필요할 때마다 피드백을 요청하여 소통을 강화했습니다. 이러한 접근 방식을 통해 고객은 저와 팀에 대한 신뢰를 보이기 시작했고, 결국 해당 고객은 장기적인 파트너로 남게 되었습니다. 이 경험을 통해 영업에서의 신뢰 형성이 얼마나 중요한지를 깨달았습니다.','[{\"start\":0.0,\"end\":2.7,\"text\":\" 테스트 중입니다\",\"intent\":\"태도(H/W, S/W 역량)\"}]','테스트 중입니다','384a037c-b156-48b6-8038-8ff33da015ad',1,NULL,NULL),('bddf9a86-7eef-4fde-ad01-441460513a8a','[{\"second\":1,\"expression\":\